    n = int(stdin)
    def factors(n):
        return list(reduce(list.__add__, ([i, n//i] for i in range(1, int(n**0.5) + 1) if n % i == 0)))

    factors = factors(n)
    def is_rectangle(cuts):
        parts_lengths = set()
        for cut in cuts:
            parts_lengths.add(cut)
            if cut + 1 in parts_lengths or cut - 1 in parts_lengths:
                return False
        return True

    def is_square(cuts):
        parts_lengths = set()
        for cut in cuts:
            parts_lengths.add(cut)
            if cut * 2 in parts_lengths or cut / 2 in parts_lengths:
                return False
        return True

    def combinations(cuts):
        if len(cuts) < 4:
            return 1
        ways = 1
        for i in range(1, len(cuts)):
            left_cuts = cuts[:i]
            right_cuts = cuts[i:]
            if not is_rectangle(left_cuts) or not is_rectangle(right_cuts):
                continue
            left_parts_lengths = set()
            right_parts_lengths = set()
            for cut in left_cuts:
                left_parts_lengths.add(cut)
            for cut in right_cuts:
                right_parts_lengths.add(cut)
            if len(left_parts_lengths) < 4 or len(right_parts_lengths) < 4:
                continue
            if not is_square(left_parts_lengths) or not is_square(right_parts_lengths):
                continue
            ways *= 2
        return ways

    return combinations(factors)

